We then define a `aws_ec2_client_vpn_endpoint` resource:

```jsx
resource "aws_ec2_client_vpn_endpoint" "vpn" {
  description       = "PowerBI VPN"
  client_cidr_block = "10.0.0.0/22"
  split_tunnel      = true

  server_certificate_arn = aws_acm_certificate.server.arn

  connection_log_options {
    enabled = false
  }

  authentication_options {
    type                       = "certificate-authentication"
    root_certificate_chain_arn = aws_acm_certificate.client.arn
  }

  dns_servers = [
    "1.1.1.1",
    "8.8.8.8",
  ]
}
```

Where we use `split_tunnel` to ensure only RDS traffic gets routed through the VPN. We donâ€™t want to pay the data transfer costs for all other traffic!

We also need an authorisation rule:

```jsx
resource "aws_ec2_client_vpn_authorization_rule" "default" {
  client_vpn_endpoint_id = aws_ec2_client_vpn_endpoint.vpn.id
  target_network_cidr    = "10.0.0.0/16"
  authorize_all_groups   = true
}
```
